import React from "react";
import "./skills.css";
import frotEnd from "../../assets/frontEnd.png";

const Skills = () => {
  return (
    <section id="skills">
      <h2 className="skillsTitle">Technical Skills</h2>
      <div className="skillContent">
        <img src="" alt="" className="skillImage" />
        <ul>
          <li>JavaScript</li>
          <li>TypeScript</li>
          <li>React</li>
          <li>React Native</li>
          <li>HTML5</li>
          <li>CSS3</li>
          <li>Styled Components</li>
        </ul>
      </div>
    </section>
  );
};

export default Skills;
